import Container from './../../node_modules/react-bootstrap/Container';
import Nav from './../../node_modules/react-bootstrap/Nav';
import Navbar from "./../../node_modules/react-bootstrap/Navbar";
import "./../style/HomeNav.css";
import "./../../node_modules/bootstrap/dist/css/bootstrap.min.css"

function HomeNav() {
    return (
        <>
            <Navbar data-bs-theme="dark" className="navbar">
                <Container className="navbar-contents">
                <div><Navbar.Brand href="#home">Get Your Pizza</Navbar.Brand></div>
                <div>
                    <Nav className="me-auto">
                    <Nav.Link href="#home">Home</Nav.Link>
                    <Nav.Link href="#features">Features</Nav.Link>
                    <Nav.Link href="#pricing">Pricing</Nav.Link>
                    <div className='homenav-cart'><box-icon name='cart-alt'></box-icon></div>
                    </Nav>
                </div>
                </Container>
            </Navbar>
        </>
    );
}

export default HomeNav
